We went light on the mains and opted for the butternut squash with fig leaf oil, yoghurt, and pepita‚Äôs. It was elaborately brought out on a trolley on carved at the table. The raw tuna with kombu and grilled cucumber was a great mix of umami flavours, and our palates were delightfully cleansed with the polenta cake and mandarin granita for dessert.

